Widget customtile(color, nametext, text, icon, address) {
  return ListTile(
    tileColor: color,
    leading: CircleAvatar(
      backgroundImage: NetworkImage(address),
    ),
    title: Text(nametext),
    subtitle: Text(text),
    trailing: Icon(icon),
  );
}
